import React from "react";
import styles from "./styles.module.css";
const SideBar = () => {
  return (
    <>
      <div className={styles.sideBarContainer}>
        <div id="sideBar" className={styles.sideBar}></div>
      </div>
    </>
  );
};
export default SideBar;
